sys_variable_value.value:
(function execute(inputs, outputs) {
    var arr_input = inputs.array_input;
    var arr_length = arr_input.length;
    if (arr_length > 0) {
        outputs.result = true;
    } else {
        outputs.result = false;
    }
})(inputs, outputs);

